import './App.css';

import { Navbar, Header, Project } from './components';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar></Navbar>
        <Header></Header>
        <hr></hr>
        <Router>
          <Route path="/projects">
            <Project></Project>
          </Route>
        </Router>
      </div>
    </Router>
  );
}

export default App;
